import { StyleSheet, Text, TextInput, View } from "react-native";

export const Header = () => {
  return (
	 <View style={styles.container}>Work</View>
  )
}


const styles = StyleSheet.create({
	container: {
	  display: "flex",
	  flexDirection: "row",
	  alignItems: "center",
	  borderColor: "#e4e3e3",
	  border: 1,

	  padding: 10,
	  height: 40,
	  width: "100%",
	},
 });
